import React from 'react';

function AllHistory() {
  // ダミーデータ
  const transactions = [
    { id: 1, from: 'ユーザー1', to: 'ユーザー2', amount: 10, date: '2023-05-01' },
    { id: 2, from: 'ユーザー3', to: 'ユーザー1', amount: 5, date: '2023-05-02' },
    { id: 3, from: 'ユーザー2', to: 'ユーザー4', amount: 15, date: '2023-05-03' },
  ];

  return (
    <div className="container">
      <h2>全履歴</h2>
      <table>
        <thead>
          <tr>
            <th>日付</th>
            <th>送信元</th>
            <th>送信先</th>
            <th>金額</th>
          </tr>
        </thead>
        <tbody>
          {transactions.map((tx) => (
            <tr key={tx.id}>
              <td>{tx.date}</td>
              <td>{tx.from}</td>
              <td>{tx.to}</td>
              <td>{tx.amount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AllHistory;
